"""
Two strings X and Y are similar if we can swap two letters (in different positions) of X, so that it equals Y.

For example, "tars" and "rats" are similar (swapping at positions 0 and 2), and "rats" and "arts" are similar, but "star" is not similar to "tars", "rats", or "arts".

Together, these form two connected groups by similarity: {"tars", "rats", "arts"} and {"star"}.  Notice that "tars" and "arts" are in the same group even though they are not similar.  Formally, each group is such that a word is in the group if and only if it is similar to at least one other word in the group.

We are given a list A of unique strings.  Every string in A is an anagram of every other string in A.  How many groups are there?

Example 1:

Input: ["tars","rats","arts","star"]
Output: 2
Note:

A.length <= 2000
A[i].length <= 1000
A.length * A[i].length <= 20000
All words in A consist of lowercase letters only.
All words in A have the same length and are anagrams of each other.
The judging time limit has been increased for this question.

"""


class Solution(object):
    def numSimilarGroups(self, A):
        """
        :type A: List[str]
        :rtype: int
        10471 ms
        """
        if len(A) == 0:
            return 0
        M = len(A)
        N = len(A[0])
        # print(M, N)
        def diff(word1, word2):
            count = 0
            l = len(word1)
            for i in range(l):
                if word1[i] != word2[i]:
                    count += 1
                if count >= 3:
                    return False
            if count == 2 or count == 0:
                return True
            else:
                return False

        def bfs(S):
            start = set()
            for i in S:
                start.add(i)
                break
            while start:
                next_list = set()
                for word1 in start:
                    used = set()
                    for word2 in S:
                        if diff(word1, word2):
                            next_list.add(word2)
                            used.add(word2)
                    S = S.difference(used)
                start = next_list
            return S
        def find(word, i, j):
            word[i], word[j] = word[j], word[i]
            return  ''.join(word)

        def bfs2(S):
            start = set()
            used = set()
            for i in S:
                start.add(i)
                break
            while start:
                next_list = set()
                for word1 in start:
                    used.add(word1)
                    word1 = list(word1)
                    for i in range(N - 1):
                        for j in range(i, N):
                            word2 = find(word1, i, j)
                            word1[i], word1[j] = word1[j], word1[i]
                            if word2 in S:
                                S.remove(word2)
                                if word2 not in used:
                                    next_list.add(word2)

                start = next_list
            return S

        S = set(A)
        ans = 0
        if M < N:
            while S:
                S = bfs(S)
                ans += 1
            return ans
        else:
            while S:
                S = bfs2(S)
                # print(S)
                ans += 1
            return ans

    def numSimilarGroups_1(self, A):
        """
        5238ms
        :param A: 
        :return: 
        """
        def explore(s):
            visited.add(s)
            for v in edges[s]:
                if v not in visited: explore(v)

        res, edges, visited = 0, {}, set()
        if len(A) >= 2 * len(A[0]):
            strs = set(A)
            for s in A:
                if s not in edges: edges[s] = set()
                for i in range(len(s) - 1):
                    for j in range(i + 1, len(s)):
                        new = s[:i] + s[j] + s[i + 1:j] + s[i] + s[j + 1:]
                        if new in strs:
                            edges[s].add(new)
                            if new in edges:
                                edges[new].add(s)
                            else:
                                edges[new] = {s}
        else:
            for s in A:
                if s not in edges: edges[s] = set()
                for t in A:
                    if s != t:
                        same = 0
                        for i, c in enumerate(t):
                            if c == s[i]: same += 1
                        if same == len(s) - 2:
                            edges[s].add(t)
                            if t in edges:
                                edges[t].add(s)
                            else:
                                edges[t] = {s}
        for s in A:
            if s not in visited:
                res += 1
                explore(s)
        return res


